#include <iostream>
#include <algorithm>
#include <string>
#include <map>
#include <vector>
#include <numeric>
using namespace std;

#define g(c) (1<<(c-'a'))

inline int64_t h(string s) {
	return accumulate(s.begin(), s.end(), 0, [](int64_t r, char c){
		return r + g(c);
	});
}

vector<int> findAnagrams(string s, string p) {
	int hp = h(p);
	int m = p.size();
	int n = s.size();
	vector<int> res;
	auto h0 = h(s.substr(0,m));
	for (int i=m; i<n; ++i) {
		if (h0 == hp)
			res.push_back(i-m);
		h0 = h0 - g(s[i-m]) + g(s[i]);
	}
	if (h0 == hp)res.push_back(n-m);
	return res;
}

int main(int argc, char *argv[]) {
	vector<vector<string>> input = {
		{"cbaebabacd", "abc"},
		{"abab", "ab"},
		{"",
		""}
	};
	
	vector<vector<int>> res;
	transform(input.begin(), input.end(), back_inserter(res), [](vector<string>& v){
		return findAnagrams(v[0], v[1]);
	});
	
	for_each(res.begin(), res.end(), [](vector<int>& r){
		copy(r.begin(), r.end(), ostream_iterator<int>(cout, ", "));
		cout << endl;
	});
}